MODELLO.MAT.mappaAree = function(){
	for(let m=0;m<4;m++){
		MODELLO.MAT.materialAree[m] = new THREE.MeshStandardMaterial( { // AREE
			flatShading:false,
			color: new THREE.Color( 1, 1, 1 ),
			transparent:true,
			roughness:0.7,
			side: 3,
			needsUpdate: true,
			bumpScale: 0.006
		
		} );
	}
	
	var imageHead = new Image();
	imageHead.src =  Muscle_Head;
	var textureHead = new THREE.Texture();
	textureHead.image = imageHead;
	imageHead.onload = function() {
		textureHead.needsUpdate = true;
	};
	MODELLO.MAT.materialAree[3].map = textureHead;
	if(typeof(Muscle_Head_bump) != 'undefined'){
		var imageHeadB = new Image();
		imageHeadB.src =  Muscle_Head_bump;
		var textureHeadB = new THREE.Texture();
		textureHeadB.image = imageHeadB;
		imageHeadB.onload = function() {
			textureHeadB.needsUpdate = true;
		};
		MODELLO.MAT.materialAree[3].bumpMap = textureHeadB;
	}
	
	var imageTorso = new Image();
	imageTorso.src =  Muscle_Torso;
	var textureTorso = new THREE.Texture();
	textureTorso.image = imageTorso;
	imageTorso.onload = function() {
		textureTorso.needsUpdate = true;
	};
	MODELLO.MAT.materialAree[2].map = textureTorso;
	if(typeof(Muscle_Torso_bump) != 'undefined'){
		var imageTorsoB = new Image();
		imageTorsoB.src =  Muscle_Torso_bump;
		var textureTorsoB = new THREE.Texture();
		textureTorsoB.image = imageTorsoB;
		imageTorsoB.onload = function() {
			textureTorsoB.needsUpdate = true;
		};
		MODELLO.MAT.materialAree[2].bumpMap = textureTorsoB;
	}
	
	var imageLimbs = new Image();
	imageLimbs.src =  Muscle_Limbs;
	var textureLimbs = new THREE.Texture();
	textureLimbs.image = imageLimbs;
	imageLimbs.onload = function() {
		textureLimbs.needsUpdate = true;
	};
	MODELLO.MAT.materialAree[1].map = textureLimbs;
	if(typeof(Muscle_Limbs_bump) != 'undefined'){
		var imageLimbsB = new Image();
		imageLimbsB.src =  Muscle_Limbs_bump;
		var textureLimbsB = new THREE.Texture();
		textureLimbsB.image = imageLimbsB;
		imageLimbsB.onload = function() {
			textureLimbsB.needsUpdate = true;
		};
		MODELLO.MAT.materialAree[1].bumpMap = textureLimbsB;
	}
	
	MODELLO.MAT.materialAree[0].setValues( { color: 0xfdefdf } ); // occhi
	
}

